import React, { Component } from "react";

import "./App.css";
import "./Project.css";
import Image from "./Image.js";


class Project extends Component {

  constructor(){
    super();

  }

  render() {
    const { params } = this.props.match;


    return (
      <div className="Project">
          <div className="para">
          <h1>
          { params.id }
          </h1>

          <Image imgSrc="https://user-images.githubusercontent.com/15258799/57022768-4612bb80-6c5a-11e9-820d-9f0532f92303.gif"/>
          <p>
          I'm currently still writing the code for this part. If you like, you can download the pdf version of the portfolio <a rel="noopener noreferrer" href="https://drive.google.com/open?id=17e4sgCcPEhqvgychJFk4K-o74r1p-i7J" target="_blank">here</a>.
          </p>
        </div>
      </div>
    );
  }
}

export default Project;
